"             &nbsp;",
"             <input name=\"Height_Father_param\" onblur=\"HeightPotential_fx(); minMaxCheck();\" onchange=\"HeightPotential_fx();\" size=\"6\" type=\"text\" value=\"\"/>",
"            </td>",
"            <td align=\"left\" valign=\"top\" width=\"115\">",
"             <select class=\"medCalcFontSelect\" name=\"Height_Father_unit\" onchange=\"HeightPotential_fx();\" style=\"width:105px;\">",
"              <option selected=\"selected\" value=\"1|0|cm\">",
"               cm",
"              </option>",
"              <option value=\"2.54|0|in\">",
"               in",
"              </option>",
"              <option value=\"100|0|m\">",
"               m",
"              </option>",
"             </select>",
