"             </span>",
"            </td>",
"            <td nowrap=\"nowrap\" valign=\"top\">",
"             &nbsp;",
"             <input name=\"Height_Potential_param\" onfocus=\"blur();\" size=\"6\" type=\"text\"/>",
"            </td>",
"            <td valign=\"top\">",
"             <span class=\"medCalcFontOne\">",
"              <select class=\"medCalcFontSelect\" name=\"Height_Potential_unit\" onchange=\"HeightPotential_fx();\" style=\"width:105px;\">",
"               <option selected=\"selected\" value=\"1|0|cm\">",
"                cm",
"               </option>",
"               <option value=\"2.54|0|in\">",
"                in",
"               </option>",
"               <option value=\"100|0|m\">",
"                m",
