"             &nbsp;",
"             <br/>",
"            </td>",
"           </tr>",
"          </table>",
"         </center>",
"         <br/>",
"         &nbsp;",
"         <br/>",
"         <center>",
"          <span class=\"medCalcFontOne\">",
"           <input name=\"reset\" type=\"reset\" value=\"Reset form\"/>",
"          </span>",
"         </center>",
"        </td>",
"       </tr>",
"      </table>",
"     </center>",
"    </div>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <div id=\"calc_hints\">",
"     <span class=\"medCalcFontOne\">",
"      This height prediction is based on the sex adjusted mid-parental height, using the following formulae:",
"     </span>",
"     <ul class=\"medCalcFontOne\">",
"      <li>",
"       Girls: subtract 13 cm from the father's height and average with the mother's height.",
"      </li>",
"      <li>",
"       Boys: add 13 cm to the mother's height and average with the father's height.",
"      </li>",
"      <li>",
"       13 cm is the average difference in height of women and men.",
"      </li>",
"      <li>",
"       For both girls and boys, 8.5 cm on either side of this calculated value (target height) represents the 3rd to 97th percentiles for anticipated adult height.",
"      </li>",
"     </ul>",
"    </div>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <div id=\"calc_refs\">",
"     <span class=\"medCalcFontRef\">",
"      <b>",
"       References",
"      </b>",
"     </span>",
