"      <li>",
"       <span class=\"medCalcFontRef\">",
"        Tanner JM, Goldstein H, Whitehouse RH. Standards for children's height at ages 2-9 years allowing for heights of parents.",
"        <i>",
"         Arch Dis Child",
"        </i>",
"        . 1970 Dec;45(244):755-62.",
"       </span>",
"      </li>",
"     </ol>",
"    </div>",
"   </form>",
"  </div>",
