var script_f30_3_30769=[" ",
"",
"",
"function log(i){",
"return Math.log(i) * Math.LOG10E;   ",
"}",
"",
"function ln(i){",
"return Math.log(i);",
"}",
"",
"function sq(i){",
"return i * i;",
"}",
"",
"function sqr(i){",
"return Math.sqrt(i);",
"}",
"",
"",
"function power(x,y){",
"return Math.pow(x,y);",
"}",
"",
"function eTo(x){",
"return Math.exp(x);",
"}",
"",
"",
"function fixDP(r, dps) {",
"if (isNaN(r)) return \"NaN\";",
"var msign = '';",
"if (r < 0) msign = '-';",
"x = Math.abs(r);",
"if (x > Math.pow(10, 21)) return msign + x.toString();",
"var m = Math.round(x * Math.pow(10, dps)).toString();",
"if (dps == 0) return msign + m;",
"while (m.length <= dps) m = \"0\" + m;",
"return msign + m.substring(0, m.length - dps) + \".\" + m.substring(m.length - dps);",
"}",
"",
"function alertNaN(){",
"alert('This field is improperly formatted. You may only input the digits 0-9 and a decimal point.');  ",
"doCalc = false; ",
"clrResults();",
"}",
"",
"",
"function validNumberField(event) {",
"var field = event.target;",
"",
"if(field && field != 'undefined' && field.attributes.type.nodeValue && (field.attributes.type.nodeValue == 'number')) {",
"var val = field.value;",
"var charCode = event.charCode;",
"var key = String.fromCharCode(charCode);",
"",
"if(charCode == 0) {",
"return true;",
"}",
"",
"if(key == ' ') {",
"alert('Numeric field cannot contain spaces.');",
"return false;",
"}	",
"		",
"if(val.length == 0) {",
"if(key == '+') { return true; }",
"if(key == '-') { return true; }	",
"if(key == '.') { return true; }",
"}",
"		",
"if(key == '.') { return validFloat(val, key); }",
"",
"if(isNaN(parseInt(key))) {",
"alertNaN();",
"return false;",
"}",
"	",
"return validFloat(val, key);",
"}",
"return true;",
"}",
"",
"",
"function validFloat(val, key) {",
"var currentVal = parseFloat(val + key);",
"if(isNaN(val + key) || isNaN(currentVal)) {",
"alertNaN();",
"}",
"return true;",
"}",
"",
"var currenttimeout;",
"",
"",
"var calctxt = ''; ",
"var xmltxt = ''; ",
"var htmtxt = ''; ",
"",
"",
"",
"function HeightPotential_fx() {",
"",
"currenttimeout = self.setTimeout('minMaxCheck();', 2000);",
"",
"with(document.HeightPotential_form){",
"",
"",
"doCalc = true;",
"if (Sex_radio[0].checked){ Sex = 1; }",
"if (Sex_radio[1].checked){ Sex = 2; }",
"param_value = parseFloat(Height_Mother_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Height_Mother_unit.options[Height_Mother_unit.selectedIndex].value.split('|');",
"Height_Mother = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"param_value = parseFloat(Height_Father_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Height_Father_unit.options[Height_Father_unit.selectedIndex].value.split('|');",
"Height_Father = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"dp = 0;",
"if (Sex == 1){",
"HP_Sex = ((Height_Father - 13) + Height_Mother) / 2",
"}",
"if (Sex == 2){",
"HP_Sex = ((Height_Mother + 13) + Height_Father) / 2",
"}",
"Height_Potential =  HP_Sex;",
"",
"unit_parts = Height_Potential_unit.options[Height_Potential_unit.selectedIndex].value.split('|');",
"if (doCalc) Height_Potential_param.value = fixDP((Height_Potential - parseFloat(unit_parts[1])) / parseFloat(unit_parts[0]), dp);",
"",
"",
"",
"",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.HeightPotential_form){",
"",
"if (Height_Mother_param.value && isNaN(Height_Mother_param.value)){ Height_Mother_param.value = ''; alertNaN(); }",
"if (Height_Mother_param.value && Height_Mother < 0) {",
"Height_Mother = 0;",
"Height_Mother_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Height Mother is 0 cm.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Height_Mother_param.value && Height_Mother > 300) {",
"Height_Mother_param.value = \"\";",
"clrResults();",
"Height_Mother = 0;",
"doCalc = false;",
"alert(\"The maximum value for Height Mother is 300 cm.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Height_Father_param.value && isNaN(Height_Father_param.value)){ Height_Father_param.value = ''; alertNaN(); }",
"if (Height_Father_param.value && Height_Father < 0) {",
"Height_Father = 0;",
"Height_Father_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Height Father is 0 cm.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Height_Father_param.value && Height_Father > 300) {",
"Height_Father_param.value = \"\";",
"clrResults();",
"Height_Father = 0;",
"doCalc = false;",
"alert(\"The maximum value for Height Father is 300 cm.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.HeightPotential_form){",
"",
"Height_Potential_param.value = '';",
"",
"",
"}",
"",
"}",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
""].join("\n");
