var title_f30_3_30774="Ultrasound traumatic neuroma";
var content_f30_3_30774=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"videoplayer\" h264=\"./images/NEURO/51601/US_traumatic_neuroma_conv.mp4?title=Ultrasound+traumatic+neuroma\" style=\"width:320px;height:256px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Ultrasound traumatic neuroma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 448px; height: 596px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This is a real-time image of the median nerve at the wrist in a woman who had old self-inflected slash wounds on the wrist. Months after this, a small palpable cyst like structure developed that was sensitive to touch causing median nerve distribution paresthesias. Ultrasound shows a normal median nerve (N) distal and proximal to this enlarged cystic traumatic neuroma (TN), with demonstrable continuity both in the axial (first segment) and sagittal (second segment) plane as the probe is moved from the wrist proximally over the cystic structure.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Francis O Walker, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
