" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Hematopoietic cell transplantation in sickle cell disease",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
