"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?5/25/5529?source=related_link\">",
"      Efficacy of hematopoietic cell transplantation in beta thalassemia major",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?16/40/17030?source=related_link\">",
"      Hematopoietic cell transplantation for Diamond-Blackfan anemia and the myelodysplastic syndromes in children",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?17/50/18217?source=related_link\">",
"      Hematopoietic cell transplantation in aplastic anemia",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
