"     <a class=\"medical medical_basics\" href=\"UTD.htm?39/8/40066?source=related_link\">",
"      Patient information: Acromegaly (The Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?13/9/13464?source=related_link\">",
"      Pituitary gigantism",
