var script_f30_3_30780=[""].join("\n");
var outline_f30_3_30780=null;
var title_f30_3_30781="Clues viral CNS infections children";
var content_f30_3_30781=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F56505&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F56505&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical clues to viral infections of the central nervous system in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Etiology",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Frequency of meningitis versus encephalitis*",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Potential clinical clues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Meningitis",
"       </td>",
"       <td class=\"subtitle2\">",
"        Encephalitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"4\">",
"        Enteroviruses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Coxsackie A and B viruses",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Herpangina, hand-foot-mouth disease, conjunctivitis, pharyngitis, pleurodynia, myopericarditis, rash",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Echoviruses",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Rash",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Polioviruses",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Flaccid paralysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"4\">",
"        Arthropod-borne viruses (arboviruses)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        West Nile virus",
"       </td>",
"       <td>",
"        Infrequent",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Rash; mosquito exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        St. Louis encephalitis virus",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Mosquito exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        La Crosse (California) encephalitis virus",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Mosquito exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Eastern equine encephalitis virus",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Mosquito exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Western equine encephalitis virus",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Mosquito exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Powassan virus",
"       </td>",
"       <td>",
"        Uncommon",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Tick exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"4\">",
"        Herpesviruses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Herpes simplex type 1",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Oral lesions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Herpes simplex type 2",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Genital lesions, sacral radiculopathy (urinary retention, constipation, paresthesia, weakness)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Cytomegalovirus",
"       </td>",
"       <td>",
"        Infrequent",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Immunocompromised host",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Varicella zoster virus",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Infrequent",
"       </td>",
"       <td>",
"        Vesicular rash; shingles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Epstein-Barr virus",
"       </td>",
"       <td>",
"        Infrequent",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"4\">",
"        Other viruses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Human immunodeficiency virus",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Intravenous drug use, risky sexual behavior",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Rabies virus",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Animal exposure; prodrome of nonspecific symptoms (fever, headache, malaise, myalgia, cough, sore throat, nausea, vomiting)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Lymphocytic choriomeningitis virus",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Infrequent",
"       </td>",
"       <td>",
"        Rodent pets or contact with rodent droppings or urine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Influenza virus",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Classic influenza symptoms: fever, cough, vomiting, headache, diarrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Mumps virus",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Infrequent",
"       </td>",
"       <td>",
"        Painful parotitis; occurs in unvaccinated or incompletely vaccinated individuals",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Measles virus",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Conjunctivitis, coryza, cough; occurs in unvaccinated or incompletely vaccinated individuals",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The terms common, infrequent, and rare refer to the propensity of a viral CNS infection to result in either meningitis or encephalitis and not to how commonly a specific virus causes CNS infection.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
