var title_f30_3_30782="Heel to toe walk video";
var content_f30_3_30782=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1070px;\">",
"  <div class=\"videoplayer\" h264=\"./images/PC/68978/Heel_to_toe_walk_video.mp4?title=Heel+to+toe+walk+video\" style=\"width:480px;height:336px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Balance exercise video: Heel to toe walk",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 369px; height: 297px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Having good balance is important for many everyday activities, such as going up and down stairs.",
"    <br>",
"     <ol>",
"      <li>",
"       Position the heel of one foot just in front of the toes of the other foot. Your heel and toes should touch or almost touch.",
"      </li>",
"      <li>",
"       Choose a spot ahead of you and focus on it to keep you steady as you walk.",
"      </li>",
"      <li>",
"       Take a step. Put your heel just in front of the toe of your other foot.",
"      </li>",
"      <li>",
"       Repeat for 20 steps.",
"      </li>",
"     </ol>",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      Reproduced from: Go4Life. National Institute on Aging at the National Institutes of Health. Available at: file://go4life.niapublications.org (Accessed December 2, 2011).",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
